            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: 3
        },
        {
            id: 2,
            image: "https://example.com/teddy-bear.jpg",
            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: 3,
        },
        {
            id: 3,
            image: "https://example.com/teddy-bear.jpg",
            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: 3
        },
    ];

    return (
        // <div className="product-page">
